import React from "react";
import TextField from "@material-ui/core/TextField";
function SignUpScreen() {
  return (
    <div>
      <TextField
        id="standard-textarea"
        label="Multiline Placeholder"
        placeholder="Placeholder"
        multiline
      />
    </div>
  );
}
export default SignUpScreen;
